import React from 'react'

function TableBody({ activeUserId }) {
    const userContacts = JSON.parse(localStorage.getItem('userContacts'))

    const getData = () => {
        userContacts.forEach((userContact) => {
            if (userContact.userId === activeUserId) {
                for (const contactItem in userContact) {
                    if (
                        contactItem !== 'userId' &&
                        contactItem !== 'contactId'
                    ) {
                        console.log(userContact[contactItem])
                        return <td>{userContact[contactItem]}</td>
                    }
                }
            }
        })
    }

    return <tr>{getData()}</tr>
}

export default TableBody
